import React from "react";

const Links = () => {
  return (
    <div className="generalPages">
      <div>
        <h2>Ссылки</h2>
      </div>
      <div>
        <p><br/><a target="_blank" href="http://www.obd-memorial.ru/">http://www.obd-memorial.ru/</a>  - <strong>Обобщенный банк данных</strong>, содержащий информацию о защитниках Отечества, погибших и пропавших без вести в период Великой Отечественной войны и послевоенный период.&nbsp;</p>
        <p><a target="_blank" href="http://library.karelia.ru/karelfront/main.html">http://library.karelia.ru/karelfront/main.html</a> - <strong>Виртуальный путеводитель &laquo;Книги о Карельском фронте&raquo;</strong>.&nbsp;Национальная библиотека Республики Карелия предлагает иллюстрированный путеводитель по книгам из фондов библиотеки, посвященный военным событиям, происходящим на Карельском фронте.&nbsp;В путеводитель включены основные издания за разные годы, содержащие различные аспекты исследований и воспоминания о военной истории Карелии.</p>
        <p><a target="_blank" href="http://pobeda.karelia.ru/">http://pobeda.karelia.ru/</a> -&nbsp;Сайт <strong>&quot;А зори здесь тихие ...&quot;</strong>, посвященный 60-летию Великой Победы, создан в рамках&nbsp;конкурса блоков интернет-страниц субъектов Российской Федерации Всероссийской эстафеты &quot;Равнение на победу&quot;, 2005.</p>
        <p><a target="_blank" href="http://pobeda.gov.karelia.ru/">http://pobeda.gov.karelia.ru/</a> - <strong>Дню Победы посвящается</strong>. Раздел на&nbsp;Официальном сервере органов государственной власти РК.</p>
        <p><a target="_blank" href="http://kronos.narc.fi/menehtyneet/">http://kronos.narc.fi/menehtyneet/</a>&nbsp;- <strong>Arkistolaitos -&nbsp;Suomen sodissa 1939-1945 menehtyneiden tiedosto</strong>.&nbsp;K&auml;yt&ouml;ss&auml;nne ovat tiedot Suomen sodissa 1939-1945 menehtyneist&auml; suomalaisista. Tietokannasta l&ouml;ytyy yli 95 000 henkil&ouml;&auml;, joita voitte etsi&auml; sukunimen, etunimen, syntym&auml;- tai kuolinajan mukaan tai vaikkapa kunnittain. Palvelu mahdollistaa tietojen hakemisen my&ouml;s joukko-osaston tai menehtymispaikan mukaan.</p>
        <p><strong>ДРУЗЬЯ САЙТА</strong></p>
      </div>
    </div>
  );
};

export default Links;
